export class Filemain extends React.Component {
    constructor() {
        super();
        this.state = {
            selectedOption: '',
            selectedItemArr: [],
        }
        this.getOption = this.getOption.bind(this);
        this.sortArr = this.sortArr.bind(this);
    }

    getOption(option) {
        console.log('>>>>>', option);
        if (option) {
            if (option.name === 'Clothes') {
                this.setState({
                    selectedOption: option.name,
                    selectedItemArr: Clothes
                })
            }
            else if (option.name === 'Shoes') {
                this.setState({
                    selectedOption: option.name,
                    selectedItemArr: Shoes
                })
            }
            else if (option.name === 'Electronics') {
                this.setState({
                    selectedOption: option.name,
                    selectedItemArr: Electronics
                })
            }
        }
    }

    sortArr(){
        var sortedArr =[];
        sortedArr = this.props.selectedItemArr.sort(function (a,b){
            return a.price - b.price;
        });
    }

    render() {
        return (
            <div>
                <div>
                    <Headermain getOption={this.getOption} sortArr = {this.sortArr}/>
                    <BodyWork selectedItemArr={this.state.selectedItemArr} />
                </div>
            </div>
        );
    }
}
export default Filemain;